ringsAsFactors = FALSE)\r\ntitanictest \u003c- read.csv(\u0022../input/test.csv\u0022, header = TRUE,  stringsAsFactors = FALSE)\r\n\r\n\r\ntitanic=bind_rows(titanictrain,titanictest)  # combining train and test datasets\r\n\r\n\r\n# Feature Engineering I\r\n\r\ntitanic$Surname=gsub(\u0027(,.*)\u0027,\u0027\u0027,titanic$Name)               # New feature Surname\r\n\r\ntitanic$Title=gsub(\u0027(.*, )|(\\\\..*)\u0027,\u0027\u0027,titanic$Name)        # New feature Title\r\ntable(titanic$Title)\r\n\r\ntitanic[titanic$Title %in% c(\u0022Ms\u0022,\u0022Mlle\u0022),]$Title=\u0022Miss\u0022    # Combining titles belonging to same class\r\ntable(titanic$Title)\r\n\r\ntitanic[!(titanic$Title %in% c(\u0022Miss\u0022,\u0022Mr\u0022,\u0022Mrs\u0022,\u0022Master\u0022)),]$Title=\u0022Special\u0022  # Combining unique titles into one class\r\ntable(titanic$Title)\r\n\r\ntitanic$FamilySize=titanic$SibSp+titanic$Parch+1            # New feature Family Size\r\n\r\nfactor_vars \u003c- c(\u0027PassengerId\u0027,\u0027Pclass\u0027,\u0027Sex\u0027,\u0027Embarked\u0027,\r\n                 \u0027Title\u0027,\u0027Survived\u0027)\r\n\r\ntitanic[factor_vars] \u003c- lapply(titanic[factor_vars], function(x) as.factor(x))\r\n\r\nstr(titanic)\r\n\r\n\r\n# Dealing with Missing Values\r\n\r\nsummary(titanic)\r\n\r\n# Count of missing values\r\n# Fare - 1\r\n# Embarked - 2\r\n# Age  - 263\r\n\r\n#   Missing Fare\r\n\r\nsum(is.na(titanic$Fare))\r\npcl\u003c-titanic[which(is.na(titanic$Fare)),]$Pclass\r\npcl           # Missing Fare is of Pclass 3\r\n      \r\nfillfare\u003c-mean(titanic[!is.na(titanic$Fare) \u0026 titanic$Pclass==pcl,]$Fare)\r\nfillfare      # Filling missing Fare with mean of Fare of Travellers of Pclass 3\r\n\r\ntitanic[is.na(titanic$Fare),]$Fare\u003c-fillfare  # Mean = 13.30289\r\nsum(is.na(titanic$Fare))\r\n\r\n\r\n#   Missing Embarked\r\n\r\nsum(is.na(titanic$Embarked))\r\ntitanic[is.na(titanic$Embarked),]\r\ntitanic[is.na(titanic$Embarked),]$Fare   #  Both missing Embarked values had Fare 80\r\n\r\n#   Plotting a Boxplot Fare corresponding Embarked to get the Embarking variable most probable to get Fare 80\r\n\r\nplot=ggplot(titanic[!is.na(titanic$Embarked),], aes(x = Embarked, y = Fare, fill = factor(Pclass))) +\r\n     geom_boxplot() +\r\n     geom_hline(aes(yintercept=80), colour=\u0027red\u0027, linetype=\u0027dashed\u0027, lwd=2) +\r\n     theme_few()\r\n\r\ntitanic[is.na(titanic$Embarked),]$Embarked\r\nsum(is.na(titanic$Embarked))\r\n\r\n# Missing Age using mice package\r\n\r\nsum(is.na(titanic$Age))\r\nmd.pattern(titanic)\r\n\r\n# Better visualisation of missing values\r\nlibrary(VIM)\r\naggr_plot=aggr(titanic, col=c(\u0027navyblue\u0027,\u0027red\u0027), numbers=TRUE, sortVars=TRUE, labels=names(data), cex.axis=.7, gap=3, ylab=c(\u0022Histogram of missing data\u0022,\u0022Pattern\u0022))\r\n\r\ntemp_titanic=mice(titanic[,!names(titanic) %in% c(\u0027PassengerId\u0027,\u0027Name\u0027,\u0027Ticket\u0027,\u0027Cabin\u0027,\u0027FamilySize\u0027,\u0027Surname\u0027,\u0027Survived\u0027)],method = \u0022rf\u0022,m=5,maxit = 50,seed=502)\r\ncomplete_titanic=complete(temp_titanic)\r\n\r\n# To see if the imputed values has the same distribution as the original\r\ndensityplot(temp_titanic)\r\npar(mfrow=c(1,2))\r\nhist(titanic$Age,freq=F,col=\u0022Red\u0022)\r\nhist(complete_titanic$Age,freq=F,col=\u0022Blue\u0022)\r\n\r\ntitanic$Age=complete_titanic$Age\r\nsum(is.na(titanic$Age))\r\n\r\n# Feature Engineering II\r\n\r\n# Creating new features from the imputed missing values \r\n\r\ntitanic$Child[titanic$Age\u003e=18]=0      \r\ntitanic$Child[titanic$Age\u003c18]=1\r\ntitanic$Child=as.factor(titanic$Child)   # New feature Child which indicate whether or not is the person a child\r\n\r\n# Prediction\r\n\r\n# Split the data into train set and a test set\r\n\r\ntrain=titanic[1:891,]\r\ntest=titanic[-(1:891),]\r\n\r\n# Logistic Regression\r\n\r\nglm.fit=glm(factor(Survived)~Pclass+Sex+Age+Embarked+SibSp+Parch+Fare+FamilySize+Child+Title,train,family = binomial,maxit=100)\r\nsummary(glm.fit)\r\npred=predict(glm.fit,test,type = \u0022response\u0022)\r\nglm.pred=rep(0,418)\r\nglm.pred[pred\u003e0.5]=1\r\nglm.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = glm.pred)\r\nglm.solution\r\nwrite.csv(file = \u0022GLMSolution.csv\u0022,glm.solution,row.names = F)\r\n\r\n# Random Forest\r\n\r\nrf.fit=randomForest(factor(Survived)~Pclass+Sex+Age+Embarked+SibSp+Parch+Fare+FamilySize+Child+Title,train,importance=TRUE)\r\nsummary(rf.fit)\r\nrf.pred=predict(rf.fit,test)\r\nrf.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = rf.pred)\r\nrf.solution\r\nwrite.csv(file = \u0022RFSolution.csv\u0022,rf.solution,row.names = F)\r\n\r\n# Prediction using CARET Package\r\n\r\n# Split the data into train set and a test set\r\n\r\ntran=titanic[1:891,]\r\ntest=titanic[-(1:891),]\r\n\r\n\r\nfit.control=trainControl(method = \u0022repeatedcv\u0022,number=5,repeats = 5)\r\n\r\n# Logistic Regression\r\n\r\nglm.fit=train(y=tran$Survived,x=tran[,c(\u0022Pclass\u0022,\u0022Sex\u0022,\u0022Age\u0022,\u0022Fare\u0022,\u0022FamilySize\u0022,\u0022Title\u0022,\u0022Embarked\u0022,\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Child\u0022)],method=\u0022glm\u0022,trControl=fit.control)\r\nprint(glm.fit)\r\n\r\nglm.pred=predict.train(glm.fit,test)\r\nglm.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = glm.pred)\r\nglm.solution\r\nwrite.csv(file = \u0022GLMSolutionCaret.csv\u0022,glm.solution,row.names = F)\r\n\r\n\r\n# Random Forest\r\n\r\nrf.fit=train(y=tran$Survived,x=tran[,c(\u0022Pclass\u0022,\u0022Sex\u0022,\u0022Age\u0022,\u0022Fare\u0022,\u0022FamilySize\u0022,\u0022Title\u0022,\u0022Embarked\u0022,\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Child\u0022)],method=\u0022rf\u0022,trControl=fit.control)\r\nprint(rf.fit)\r\n\r\nrf.pred=predict.train(rf.fit,test)\r\nrf.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = rf.pred)\r\nrf.solution\r\nwrite.csv(file u0027Surname\u0027,\u0027Survived\u0027)],method = \u0022rf\u0022,m=5,maxit = 50,seed=502)\r\ncomplete_titanic=complete(temp_titanic)\r\n\r\n# To see if the imputed values has the same distribution as the original\r\ndensityplot(temp_titanic)\r\npar(mfrow=c(1,2))\r\nhist(titanic$Age,freq=F,col=\u0022Red\u0022)\r\nhist(complete_titanic$Age,freq=F,col=\u0022Blue\u0022)\r\n\r\ntitanic$Age=complete_titanic$Age\r\nsum(is.na(titanic$Age))\r\n\r\n# Feature Engineering II\r\n\r\n# Creating new features from the imputed missing values \r\n\r\ntitanic$Child[titanic$Age\u003e=18]=0      \r\ntitanic$Child[titanic$Age\u003c18]=1\r\ntitanic$Child=as.factor(titanic$Child)   # New feature Child which indicate whether or not is the person a child\r\n\r\n# Prediction\r\n\r\n# Split the data into train set and a test set\r\n\r\ntrain=titanic[1:891,]\r\ntest=titanic[-(1:891),]\r\n\r\n# Logistic Regression\r\n\r\nglm.fit=glm(factor(Survived)~Pclass+Sex+Age+Embarked+SibSp+Parch+Fare+FamilySize+Child+Title,train,family = binomial,maxit=100)\r\nsummary(glm.fit)\r\npred=predict(glm.fit,test,type = \u0022response\u0022)\r\nglm.pred=rep(0,418)\r\nglm.pred[pred\u003e0.5]=1\r\nglm.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = glm.pred)\r\nglm.solution\r\nwrite.csv(file = \u0022GLMSolution.csv\u0022,glm.solution,row.names = F)\r\n\r\n# Random Forest\r\n\r\nrf.fit=randomForest(factor(Survived)~Pclass+Sex+Age+Embarked+SibSp+Parch+Fare+FamilySize+Child+Title,train,importance=TRUE)\r\nsummary(rf.fit)\r\nrf.pred=predict(rf.fit,test)\r\nrf.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = rf.pred)\r\nrf.solution\r\nwrite.csv(file = \u0022RFSolution.csv\u0022,rf.solution,row.names = F)\r\n\r\n# Prediction using CARET Package\r\n\r\n# Split the data into train set and a test set\r\n\r\ntran=titanic[1:891,]\r\ntest=titanic[-(1:891),]\r\n\r\n\r\nfit.control=trainControl(method = \u0022repeatedcv\u0022,number=5,repeats = 5)\r\n\r\n# Logistic Regression\r\n\r\nglm.fit=train(y=tran$Survived,x=tran[,c(\u0022Pclass\u0022,\u0022Sex\u0022,\u0022Age\u0022,\u0022Fare\u0022,\u0022FamilySize\u0022,\u0022Title\u0022,\u0022Embarked\u0022,\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Child\u0022)],method=\u0022glm\u0022,trControl=fit.control)\r\nprint(glm.fit)\r\n\r\nglm.pred=predict.train(glm.fit,test)\r\nglm.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = glm.pred)\r\nglm.solution\r\nwrite.csv(file = \u0022GLMSolutionCaret.csv\u0022,glm.solution,row.names = F)\r\n\r\n\r\n# Random Forest\r\n\r\nrf.fit=train(y=tran$Survived,x=tran[,c(\u0022Pclass\u0022,\u0022Sex\u0022,\u0022Age\u0022,\u0022Fare\u0022,\u0022FamilySize\u0022,\u0022Title\u0022,\u0022Embarked\u0022,\u0022SibSp\u0022,\u0022Parch\u0022,\u0022Child\u0022)],method=\u0022rf\u0022,trControl=fit.control)\r\nprint(rf.fit)\r\n\r\nrf.pred=predict.train(rf.fit,test)\r\nrf.solution \u003c- data.frame(PassengerID = test$PassengerId, Survived = rf.pred)\r\nrf.solution\r\nwrite.csv(file = \u0022RFSolutionCaret.csv\u0022,rf.solution,row.names = F)\r\n","dateCreated":"2017-05-21T13:31:06.57Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e472500\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:0119ca5e93bef84cc8f4d98b7d7c32de0bf493adc4fb20ae40f0386f24dae805\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e89.6292739291675\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003cwas_killed\u003eFalse\u003c/was_killed\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/ka you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancés were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1174993,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-05-21T13:31:06.57Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":0,"linesInsertedFromPrevious":30,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:0119ca5e93bef84cc8f4d98b7d7c32de0bf493adc4fb20ae40f0386f24dae805","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":89.6292739291675,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Titanic Survival Prediction - R","url":"/mailaks
